    "# **Data Collection, Description of the data sources and datasets used**\n",
    "\n",
    "**Data Sources:**\n",
    "In this analysis, we rely on Cyclistic's historical trip data, which has been generously provided by Motivate International Inc. under a licensing agreement. While the datasets used may carry different names, they are well-suited for addressing the specific business questions at the heart of this study. It is essential to highlight that the data's provision strictly adheres to data-privacy regulations, ensuring the safeguarding of personally identifiable information (PII) of the riders.\n",
    "\n",
    "**Data Collection & Selection:**\n",
    "For the scope of this analysis, the data was generously provided via a link, granting convenient and direct access to the dataset. This approach ensures seamless retrieval and utilization of the necessary historical trip data. The selected dataset corresponds to the year 2022. This choice provides a comprehensive view of one year's worth of historical trip data, facilitating the exploration of trends and patterns.\n",
    "\n",
    "**Data Privacy Considerations:**\n",
    "Respecting data privacy standards is paramount in our analysis. It is crucial to emphasize that our approach ensures the protection of individual riders' privacy. We will not access or utilize personally identifiable information, which means that we will not link pass purchases to credit card numbers, attempt to ascertain whether casual riders reside in Cyclistic's service area, or identify those who have purchased multiple single passes. Our analysis exclusively deals with aggregated and anonymized trip data, preserving the privacy and anonymity of individual riders throughout the study.\n",
    "\n",
    "**Data Location:**\n",
    "The data for this analysis is hosted externally and is accessible via a provided link, ensuring easy access for our research. Here's the link to the [Cyclistic Dataset](https://divvy-tripdata.s3.amazonaws.com/index.html)\n",
    "\n",
    "**Data Organization:**\n",
    "Our selected dataset for the year 2022 is systematically organized into 12 distinct zip files, with each zip file containing CSV files representing specific months of the year. This structured organization allows for efficient data retrieval and analysis.\n",
    "\n",
    "Data Bias, Credibility, and ROCCC:\n",
    "Concerns related to data bias and credibility do not apply to the data under examination. The data's integrity is assured, and it aligns well with the ROCCC framework:\n",
    "\n",
    "1. **Reliability:** Sourced from a reputable organization, Motivate International Inc.\n",
    "1. **Objectivity:** Collected objectively, devoid of bias.\n",
    "1. **Currency:** Current data for the year 2022. Though 2023 could have been used, it wasn't a full year\n",
    "1. **Comprehensiveness:** Encompasses all necessary attributes for comprehensive analysis.\n",
    "1. **Consistency:** Maintains a consistent format and structure, enabling meaningful insights.\n",
    "\n",
    "**Licensing, Privacy, Security, and Accessibility:**\n",
    "The data is governed by a licensing agreement with Lyft Bikes and Scooters, LLC (\"Bikeshare\"), ensuring our lawful access, usage, and analysis. The agreement strictly prohibits activities such as selling the data as a standalone dataset or attempting to correlate it with personal information of riders. Notably, the City of Chicago owns the data, and Bikeshare retains the authority to modify or discontinue data provision as deemed fit.\n",
    "\n",
    "**Data Integrity Verification:**\n",
    "My commitment to data integrity is unwavering. I have undertaken a rigorous verification process during data preprocessing, where I identified and addressed issues such as missing data, outliers, and inconsistencies. I've implemented appropriate solutions, including data cleaning and imputation, to maintain data quality.\n",
    "Data's Contribution to Answering Questions:\n",
    "The historical trip data is the cornerstone of my analysis, empowering me to address critical research questions by providing invaluable insights into user behavior, usage patterns, and rider preferences.\n",
    "\n",
    "**Potential Data Issues:**\n",
    "While the data exhibits robustness, it's important to acknowledge that no dataset is without potential issues. Any concerns I identify will be proactively resolved during the analysis phase to ensure the data's reliability and integrity throughout my study.\n"
   ]
