    "# **Data preprocessing steps**\n",
    "\n",
    "\n",
    "**Processing and Unzipping the zip files**\n",
    "\n",
    "Alright, let's dive into the above piece of code step by step:\n",
    "1. Loading Necessary Libraries: First things first, we're loading some libraries that we'll need for our data processing. These libraries, `purrr` and `readr`, are like toolboxes that contain handy functions and tools for working with data in R.\n",
    "2. Listing Zip Files More Efficiently: Instead of manually listing each zip file, this code is smart. It uses a function to list all the zip files in a specific directory. So, no need to type out each file name one by one.\n",
    "3. File Extraction: Now, here's where the action starts. We have a function called `file_extractor`. What this function does is take each of those zip files we listed earlier and unzips them. In other words, it opens up those zip files and extracts their contents. These contents are placed in a directory specified by `exdir`, making the data accessible for further work.\n",
    "4. Applying the Function: We don't just apply this function once; we apply it to each zip file using `lapply`. It's like telling the code to go through each zip file and use the `file_extractor` function to unzip them. This way, it's a lot more efficient than doing it manually for each file.\n",
    "5. Closing Open Connections: This last step is a good practice. It ensures that all files are properly closed after extraction. Think of it as making sure you don't leave any doors open after you've finished using a room.\n",
    "So, in a nutshell, this code is all about getting our data ready for analysis. It efficiently unzips a bunch of zip files, making their contents accessible for our data processing tasks. It's like a digital unpacking assistant for our data.\n",
    "\n",
    "In the process of extracting and examining the 12 datasets, a consistent pattern emerged. All of these datasets consistently featured the following columns: 'ride_id,' 'rideable_type,' 'started_at,' 'ended_at,' 'start_station_name,' 'start_station_id,' 'end_station_name,' 'end_station_id,' 'start_lat,' 'start_lng,' 'end_lat,' 'end_lng,' and 'member_casual.'\n",
    "\n",
    "These columns provide comprehensive details about each ride, including the ride's unique identifier ('ride_id'), the type of rideable used ('rideable_type'), the timestamps for the ride's start and end ('started_at' and 'ended_at'), and crucial station-related information, such as the starting and ending station names ('start_station_name' and 'end_station_name') and their corresponding IDs ('start_station_id' and 'end_station_id'). Additionally, geographical coordinates ('start_lat,' 'start_lng,' 'end_lat,' and 'end_lng') are available for precise location information. Furthermore, a key feature, 'member_casual,' signifies whether a rider is a member or a casual user.\n",
    "This consistent dataset structure lays the foundation for a streamlined and insightful analysis of Cyclistic's historical trip data, ensuring the reliability and uniformity of our findings. \n"
   ]
