    "\n",
    "# Loading the needed libraries\n",
    "\n",
    "library(purrr)\n",
    "library(readr)\n",
    "\n",
    "# Listing the zip files via a function instead of individual listing\n",
    "unzipped_file_paths <- list.files(path = \"/kaggle/input/cyclistic-data-set\", \n",
    "                             full.names = TRUE, \n",
    "                             pattern = \"\\\\.csv$\",\n",
    "                             recursive = TRUE)\n",
    "\n",
    "\n",
    "# file Writer function\n",
    "\n",
    "file_writer <- function(unzipped_file_paths, output_folder) {\n",
    "  # Check if the output folder exists, and if not, create it\n",
    "  if (!dir.exists(output_folder)) {\n",
    "    dir.create(output_folder, recursive = TRUE)\n",
    "  }\n",
    "  \n",
    "  # Loop through the list of CSV files and write them to the output folder\n",
    "  for (file in unzipped_file_paths) {\n",
    "    file_name <- sub(\".*/\", \"\", file)  # Extract the file name from the path\n",
    "    output_file <- file.path(output_folder, file_name)\n",
    "    write.csv(read.csv(file), file = output_file)\n",
    "  }\n",
    "}\n",
    "capture.output({\n",
    "  # My code producing the output\n",
    "    \n",
    "output_folder <- \"/kaggle/working/main_data\"  \n",
    "file_writer(unzipped_file_paths, output_folder)\n",
    "})\n",
    "\n"
   ]
