    "\n",
    "# Create the output directory if it doesn't exist\n",
    "if (!dir.exists(output_directory)) {\n",
    "  dir.create(output_directory)\n",
    "}\n",
    "\n",
    "# Write the combined data to the output file\n",
    "write_csv(dirty_combo, output_file)\n",
