    "# Loading Libraries\n",
    "library(tidyverse)\n",
    "library(s2)\n",
    "library(dplyr)\n",
    "\n",
    "#Fixed Start Stations Destination Folder\n",
    "if(!dir.exists(\"/kaggle/working/cleaned_data/start_fixed\")){\n",
    "dir.create(\"/kaggle/working/cleaned_data/start_fixed\", recursive = TRUE)\n",
    "}\n",
    "\n",
    "# Defining the start_station_fixer function to fix missing start station names and IDs\n",
    "start_station_fixer <- function(data) {\n",
    "  # Data separation for missing and not missing start stations\n",
    "  missing <- data %>% filter(is.na(start_station_id))\n",
    "  not_missing <- data %>% filter(!is.na(start_station_id))\n",
    "  \n",
    "  # Extract coordinates for missing and not missing start stations\n",
    "  s2_missing <- s2_lnglat(missing$start_lng, missing$start_lat)\n",
    "  s2_not_missing <- s2_lnglat(not_missing$start_lng, not_missing$start_lat)\n",
    "  \n",
    "  # Update missing start station names\n",
    "  missing$start_station_name <- not_missing$start_station_name[s2_closest_feature(s2_missing, s2_not_missing)]\n",
    "  \n",
    "  # Update missing start station IDs\n",
    "  missing$start_station_id <- not_missing$start_station_id[s2_closest_feature(s2_missing, s2_not_missing)]\n",
    "  \n",
    "  # Bind datasets\n",
    "  cleaned_data <- bind_rows(missing, not_missing)\n",
    "  \n",
    "  return(cleaned_data)\n",
    "}\n",
    "\n",
    "# Specifying the directory containing the 12 CSV files\n",
    "input_directory <- \"/kaggle/working/main_data\"\n",
    "\n",
    "#Fixed end Stations Destination Folder\n",
    "if(!dir.exists(\"/kaggle/working/cleaned_data/start_fixed\")){\n",
    "dir.create(\"/kaggle/working/cleaned_data/start_fixed\", recursive = TRUE)\n",
    "}\n",
    "\n",
    "# Specifying the output directory where the cleaned files will be saved\n",
    "output_directory <- \"/kaggle/working/cleaned_data/start_fixed\"\n",
    "\n",
    "# Listing all CSV files in the input directory\n",
    "csv_files <- list.files(input_directory, pattern = \".csv\", full.names = TRUE)\n",
    "\n",
    "# Process each CSV file\n",
    "for (i in 1:length(csv_files)) {\n",
    "  # Read the CSV file\n",
    "  data <- read_csv(csv_files[i])\n",
    "  \n",
    "  # Apply the start_station_fixer function\n",
    "  cleaned_data <- start_station_fixer(data)\n",
    "  \n",
    "  # Create the output file name\n",
    "  output_file_name <- paste0(\"start_fixed_\", i, \".csv\")\n",
    "  \n",
    "  # Create the output file path\n",
    "  output_file <- file.path(output_directory, output_file_name)\n",
    "  \n",
    "  # Write the cleaned data to the output directory\n",
    "  write.csv(cleaned_data, output_file, row.names = FALSE)\n",
    "}\n"
   ]
