   "source": [
    "# Load the necessary libraries for data manipulation and analysis\n",
    "library(tidyverse)  # Load the tidyverse package for data manipulation\n",
    "library(dplyr)      # Load the dplyr package for data transformation\n",
    "library(lubridate)  # Load the lubridate package for datetime manipulation\n",
    "\n",
    "# Importing the datasets (You may insert code here to import datasets, if needed)\n",
    "\n",
    "# List the CSV files in a directory\n",
    "csv_files <- list.files(\n",
    "  pattern = \"csv\",                                    # Look for files with the \"csv\" extension\n",
    "  full.names = TRUE,                                 # Get full file paths\n",
    "  recursive = FALSE,                                 # Search in the specified directory only (not subdirectories)\n",
    "  path = \"/kaggle/working/cleaned_data/end_fixed\"  # Directory path\n",
    ")\n",
    "\n",
    "# Define a reader function for CSV files\n",
    "csv_reader <- function(csv_files) {\n",
    "  read_csv(csv_files)  # Read and return a CSV file\n",
    "}\n",
    "\n",
    "# Define the haversine function to calculate distances between coordinates\n",
    "haversine <- function(lat1, lon1, lat2, lon2) {\n",
    "  # Convert latitude and longitude from degrees to radians\n",
    "  lat1 <- lat1 * (pi / 180)\n",
    "  lon1 <- lon1 * (pi / 180)\n",
    "  lat2 <- lat2 * (pi / 180)\n",
    "  lon2 <- lon2 * (pi / 180)\n",
    "  \n",
    "  # Radius of the Earth in kilometers\n",
    "  earth_radius <- 6371\n",
    "  \n",
    "  # Haversine formula\n",
    "  dlat <- lat2 - lat1\n",
    "  dlon <- lon2 - lon1\n",
    "  a <- sin(dlat / 2)^2 + cos(lat1) * cos(lat2) * sin(dlon / 2)^2\n",
    "  c <- 2 * atan2(sqrt(a), sqrt(1 - a))\n",
    "  ride_distance_km <- earth_radius * c\n",
    "  \n",
    "  return(ride_distance_km)\n",
    "}\n",
    "\n",
    "# Load the CSV files, combine them, and process the data\n",
    "data_combo <- csv_files %>%\n",
    "  lapply(csv_reader) %>%\n",
    "  do.call(rbind, .) %>%\n",
    "  arrange(started_at) %>%\n",
    "  mutate(\n",
    "    rideable_type = tolower(rideable_type),\n",
    "    started_at = as.POSIXct(started_at),\n",
    "    ended_at = as.POSIXct(ended_at),\n",
    "    start_station_name = trimws(start_station_name),\n",
    "    end_station_name = trimws(end_station_name)\n",
    "  ) %>%\n",
    "  filter(!is.na(start_lat) & !is.na(start_lng) & !is.na(end_lat) & !is.na(end_lng)) %>%\n",
    "  mutate(\n",
    "    ride_length_seconds = as.numeric(difftime(ended_at, started_at, units = \"secs\")),\n",
    "    day_of_week = wday(started_at, label = TRUE),\n",
    "    month_name = month(started_at, label = TRUE, abbr = FALSE),\n",
    "    membership = member_casual,\n",
    "    ride_distance_km = haversine(start_lat, start_lng, end_lat, end_lng)  # Calculate distances\n",
    "  ) %>%\n",
    "  filter(\n",
    "    ride_length_seconds > 0,\n",
    "    ride_distance_km > 0,  # Filter out rows where distance is less than or equal to zero\n",
    "    end_station_name != \"Base - 2132 W Hubbard Warehouse\",\n",
    "    ride_length_seconds <= 86400,\n",
    "    ride_distance_km <= 50\n",
    "  ) %>%\n",
    "  distinct(ride_id, .keep_all = TRUE) %>% \n",
    "  select(-member_casual)  # Remove the \"member_casual\" column\n",
    "\n",
    "\n",
    "\n",
    "destination <- dir.create(\"/kaggle/working/data_combo\")\n",
    "\n",
    "# Back up the working data to a CSV file\n",
    "write_csv(data_combo,\"/kaggle/working/data_combo/data_combo.csv\" )\n"
   ]
  },
