   "source": [
    "# Plot 1: Membership distribution\n",
    "membership_dist_plot <- data_combo %>%\n",
    "  select(membership) %>%\n",
    "  group_by(membership) %>% \n",
    "  summarize(count = n()) %>% \n",
    "  ggplot(aes(x = membership, y = count, fill = membership)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  labs(\n",
    "    title = \"Cyclistic Membership Distribution\",\n",
    "    subtitle = \"Analyzing the distribution of membership types\",\n",
    "    caption = \"Source: Motivate International Inc : Cyclistic's historical trip data\",\n",
    "    x = \"Membership Type\",\n",
    "    y = \"Rides\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(legend.position = \"none\")\n",
    "membership_dist_plot"
   ]
  },
