   "source": [
    "# Plot 2: Rideables Distribution\n",
    "rideables_dist_plot <- data_combo %>%\n",
    "  select(rideable_type) %>%\n",
    "  ggplot(aes(x = rideable_type, fill = rideable_type)) +\n",
    "  geom_bar() +\n",
    "  labs(\n",
    "    title = \"Cyclistic's Rideable Fleet\",\n",
    "    subtitle = \"Understanding the diversity of Cyclistic's rideable fleet\",\n",
    "    caption = \"Source: Motivate International Inc: Cyclistic's historical trip data\",\n",
    "    x = \"Rideable Type\",\n",
    "    y = \"Count\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(legend.position = \"none\")\n",
    "rideables_dist_plot"
   ]
  },
