   "source": [
    "rides_distribution_plot <- data_combo %>%\n",
    "  select(day_of_week, membership) %>%\n",
    "  group_by(day_of_week, membership) %>%\n",
    "  summarize(count = n()) %>%\n",
    "  ggplot(aes(x = factor(day_of_week, levels = c(\"Mon\", \"Tue\", \"Wed\", \"Thu\", \"Fri\", \"Sat\", \"Sun\"))\n",
    "             , y = count, fill = membership)) +\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  labs(\n",
    "    title = \"Membership-Based Weekly Ride Distribution\",\n",
    "    subtitle = \"Exploring Cyclistic's Ride Patterns Across Days\",\n",
    "    caption = \"Source: Motivate International Inc: Cyclistic's historical trip data\",\n",
    "    x = \"Day of the Week\",\n",
    "    y = \"Count\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(legend.position = \"top\")\n",
    "rides_distribution_plot"
   ]
  },
