   "source": [
    "# Plot 4: monthly trend in rides for 2022\n",
    "monthly_ride_distribution <- data_combo %>%\n",
    "  select(month_name, membership) %>%\n",
    "  group_by(month_name, membership) %>%\n",
    "  summarize(count = n()) %>%\n",
    "  ggplot(aes(x = factor(month_name,\n",
    "                        levels = c(\"January\", \"February\", \"March\", \"April\", \"May\", \"June\",\n",
    "                                   \"July\", \"August\", \"September\", \"October\", \"November\", \"December\"\n",
    "                        )\n",
    "  ), \n",
    "  y = count,\n",
    "  color = membership,  # Use color for line graph\n",
    "  group = membership   # Specify group for connecting lines\n",
    "  )) +\n",
    "  geom_line() +  # Use geom_line for a line graph\n",
    "  labs(\n",
    "    title = \"Monthly Ride Trends by Membership\",\n",
    "    subtitle = \"Exploring Monthly Ride Patterns Based on Membership\",\n",
    "    caption = \"Source: Motivate International Inc : Cyclistic's historical trip data\",\n",
    "    x = \"Month\",\n",
    "    y = \"Count\"\n",
    "  )  +\n",
    "  theme_minimal()\n",
    "monthly_ride_distribution"
   ]
  },
