   "source": [
    "# Plot 5: Categorization for Ride Distances For the whole Year\n",
    "ride_distance_cat <- data_combo %>%\n",
    "  select(ride_distance_km, membership) %>% \n",
    "  mutate(\n",
    "    ride_distance_category = case_when(\n",
    "      ride_distance_km < 3 ~ \"Very Short\",       # Less than 3 kilometers\n",
    "      ride_distance_km < 7 ~ \"Short\",           # 3-7 kilometers\n",
    "      ride_distance_km < 15 ~ \"Medium\",         # 7-15 kilometers\n",
    "      ride_distance_km < 30 ~ \"Long\",           # 15-30 kilometers\n",
    "      TRUE ~ \"Very Long\"                        # Anything longer than 30 kilometers\n",
    "    )) %>%\n",
    "  group_by(ride_distance_category, membership) %>% \n",
    "  summarise(count = n()) %>% \n",
    "  # Create a bar plot\n",
    "  ggplot(\n",
    "    aes(\n",
    "      x = factor(ride_distance_category, \n",
    "                 levels = c(\"Very Short\",\"Short\", \"Medium\", \"Long\", \"Very Long\"  )\n",
    "      ),\n",
    "      y = count,\n",
    "      fill = membership  # Fill bars by membership\n",
    "    )\n",
    "  ) +\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  labs(\n",
    "    title = \"Ride Distance Categorization by Membership\",\n",
    "    subtitle = \"Distribution of Ride Distances for Cyclistic Members\",\n",
    "    caption = \"Source: Motivate International Inc : Cyclistic's historical trip data\",\n",
    "    x = \"Ride Distance Category\",\n",
    "    y = \"Count\"\n",
    "  ) +\n",
    "  theme_minimal() +\n",
    "  theme(legend.position = \"top\")  # Move the legend to the top\n",
    "ride_distance_cat"
   ]
  },
