   "source": [
    "# Plot 6: Categorization for Ride Lengths Across Months\n",
    "ride_length_cat <- data_combo %>%\n",
    "  select(ride_length_seconds, membership) %>% \n",
    "  mutate(\n",
    "    ride_length_category = case_when(\n",
    "      ride_length_seconds < 900 ~ \"Very Short\",  # Less than 15 minutes (900 seconds)\n",
    "      ride_length_seconds < 1800 ~ \"Short\",     # 15-30 minutes (900-1800 seconds)\n",
    "      ride_length_seconds < 3600 ~ \"Medium\",   # 30 minutes to 1 hour (1800-3600 seconds)\n",
    "      ride_length_seconds < 7200 ~ \"Long\",     # 1-2 hours (3600-7200 seconds)\n",
    "      TRUE ~ \"Very Long\"                        # Anything longer than 2 hours\n",
    "    )\n",
    "  ) %>%\n",
    "  group_by(ride_length_category, membership) %>% \n",
    "  summarize(count = n()) %>% \n",
    "  ggplot(aes(\n",
    "    x = factor(ride_length_category,\n",
    "               levels = c(\"Very Short\",\"Short\", \"Medium\", \"Long\", \"Very Long\")),\n",
    "    y = count,\n",
    "    fill = membership\n",
    "  )) +\n",
    "  geom_bar(stat = \"identity\", position = \"dodge\") +\n",
    "  labs(\n",
    "    title = \"Categorization of Ride Distances for Cyclistic Members\",\n",
    "    subtitle = \"Membership-Based Ride Duration Categorization\",\n",
    "    caption = \"Source: Motivate International Inc : Cyclistic's historical trip data\",\n",
    "    x = \"Ride Length Category\",\n",
    "    y = \"Count\"\n",
    "  )\n",
    "ride_length_cat\n"
   ]
