   "source": [
    "membership_order<- c(\"member\", \"casual\")\n",
    "\n",
    "# Plot 7: Popular Start Stations Broken Down\n",
    "\n",
    "broken_top_start_station <- data_combo %>%\n",
    "  select(start_station_name, membership) %>%\n",
    "  group_by(start_station_name, membership) %>%\n",
    "  summarise(count = n()) %>%\n",
    "  filter(\n",
    "    start_station_name %in% c(\n",
    "      \"Streeter Dr & Grand Ave\",\n",
    "      \"University Ave & 57th St\",\n",
    "      \"DuSable Lake Shore Dr & Monroe St\",\n",
    "      \"DuSable Lake Shore Dr & North Blvd\",\n",
    "      \"Kingsbury St & Kinzie St\",\n",
    "      \"Wells St & Concord Ln\",\n",
    "      \"Michigan Ave & Oak St\",\n",
    "      \"Clark St & Elm St\",\n",
    "      \"New St & Illinois St\",\n",
    "      \"Theater on the Lake\"\n",
    "    )\n",
    "  ) %>%\n",
    "  mutate(membership = factor(membership, levels = membership_order)) %>%\n",
    "  \n",
    "  ggplot(aes(\n",
    "    x = count,\n",
    "    y = factor(start_station_name, levels = rev(c(\n",
    "      \"Streeter Dr & Grand Ave\",\n",
    "      \"University Ave & 57th St\",\n",
    "      \"DuSable Lake Shore Dr & Monroe St\",\n",
    "      \"DuSable Lake Shore Dr & North Blvd\",\n",
    "      \"Kingsbury St & Kinzie St\",\n",
    "      \"Wells St & Concord Ln\",\n",
    "      \"Michigan Ave & Oak St\",\n",
    "      \"Clark St & Elm St\",\n",
    "      \"New St & Illinois St\",\n",
    "      \"Theater on the Lake\"\n",
    "    ))),\n",
    "    fill = membership\n",
    "  )) +\n",
    "  geom_bar(stat = \"identity\", aes(group = membership), width = 0.7) +\n",
    "  labs(\n",
    "    title = \"Popular Start Stations by Membership\",\n",
    "    subtitle = \"Most Frequented Start Stations\",\n",
    "    caption = \"Source: Motivate International Inc : Cyclistic's historical trip data\",\n",
    "    x = \"Rides\",\n",
    "    y = \"Start Stations\"\n",
    "  ) +\n",
    "  theme_minimal()\n",
    "broken_top_start_station"
   ]
