   "source": [
    "# Plot 8: Popular end Stations Broken Down\n",
    "broken_top_end_station <- data_combo %>%\n",
    "  select(end_station_name, membership) %>%\n",
    "  group_by(end_station_name, membership) %>%\n",
    "  summarise(count = n()) %>%\n",
    "  filter(\n",
    "    end_station_name %in% c(\n",
    "      \"Streeter Dr & Grand Ave\",\n",
    "      \"DuSable Lake Shore Dr & North Blvd\",\n",
    "      \"University Ave & 57th St\",\n",
    "      \"DuSable Lake Shore Dr & Monroe St\",\n",
    "      \"LaSalle St & Illinois St\",\n",
    "      \"Kingsbury St & Kinzie St\",\n",
    "      \"Wells St & Concord Ln\",\n",
    "      \"Clark St & Armitage Ave\",\n",
    "      \"Michigan Ave & Oak St\",\n",
    "      \"Clark St & Schiller St\"\n",
    "    )\n",
    "  ) %>%\n",
    "  mutate(membership = factor(membership, levels = membership_order)) %>%\n",
    "  \n",
    "  ggplot(aes(\n",
    "    x = count,\n",
    "    y = factor(end_station_name, levels = rev(c(\n",
    "      \"Streeter Dr & Grand Ave\",\n",
    "      \"DuSable Lake Shore Dr & North Blvd\",\n",
    "      \"University Ave & 57th St\",\n",
    "      \"DuSable Lake Shore Dr & Monroe St\",\n",
    "      \"LaSalle St & Illinois St\",\n",
    "      \"Kingsbury St & Kinzie St\",\n",
    "      \"Wells St & Concord Ln\",\n",
    "      \"Clark St & Armitage Ave\",\n",
    "      \"Michigan Ave & Oak St\",\n",
    "      \"Clark St & Schiller St\"\n",
    "    ))),\n",
    "    fill = membership\n",
    "  )) +\n",
    "  geom_bar(stat = \"identity\", aes(group = membership), width = 0.7) +\n",
    "  labs(\n",
    "    title = \"Popular End Stations by Membership\",\n",
    "    subtitle = \"Most Frequented End Stations\",\n",
    "    caption = \"Source: Motivate International Inc : Cyclistic's historical trip data\",\n",
    "    x = \"Count\",\n",
    "    y = \"End Station Name\"\n",
    "  ) +\n",
    "  theme_minimal()\n",
    "broken_top_end_station\n"
   ]
  }
